import React from "react";
import "./Style.css";

const Pagination = ({ postsPerPage, totalPosts }) => {
  const pageNumbers = [];

  for (let i = 1; i <= Math.ceil(totalPosts / postsPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <nav>
      <ul className="list">
        {pageNumbers.map((number) => (
          <li key={number}>
            <a href={`!#`}>{number}</a>
          </li>
        ))}
      </ul>
    </nav>
  );
};

export default Pagination;
